import React, { useState } from "react";
import { Redirect } from "react-router-dom";

import { Container, List, Item, ContainerButton, Button } from "./styles";
import { logout } from "../../services/auth";

export default function Navigation({ history }) {
  const [logged, setLogged] = useState(true);

  async function handleSubmitUser() {
    history.push("/task");
  }

  async function back() {
    window.history.back();
  }

  function handleLogout() {
    logout();
    setLogged(!logged);
  }

  return (
    <Container>
      {!logged && <Redirect to="/" />}
      <List>
        <Item>
          <i className="material-icons">account_circle</i>
        </Item>
      </List>
      <ContainerButton>
        <Button onClick={handleSubmitUser}>Nova tarefa</Button>
        <Button onClick={handleLogout}>Novo usu√°rio</Button>

        <Button onClick={back}>Voltar</Button>
        <Button onClick={handleLogout}>Sair</Button>
      </ContainerButton>
    </Container>
  );
}
